  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Bear River
  Migratory Bird Refuge outlines Refuge accomplishments during the 1974 fiscal year.
  The report begins by summarizing the weather conditions, habitat conditions, and
  food and cover conditions during the year. Wildlife including migratory birds, upland
  game birds, furbearers, predators, rodents, raptors, and diseases is also covered.
  The Refuge development and maintenance section discusses physical developments and
  collections and receipts. Resource management is outlined; topics include fur harvesting
  and commercial fishing. A progress report on field investigations and applied research
  is also provided. The public relations section of the report describes recreational
  uses, Refuge participation, hunting, violations, and safety.\",\n\t\"license_title\":
